[OSEv3:children]
masters
nodes
etcd
lb
[OSEv3:vars]
#The following parameters is used by post-actions
use_rpm_playbook=true
openshift_playbook_rpm_repos=[{'id': 'aos-playbook-rpm', 'name': 'aos-playbook-rpm', 'baseurl': 'http://xyz.com/RHAOS/AtomicOpenShift/3.3/latest/RH7-RHAOS-3.3/x86_64/os', 'enabled': 1, 'gpgcheck': 0}]
update_is_images_url=registry.xyz.com

#The following parameters is used by openshift-ansible
ansible_ssh_user=root

openshift_master_default_subdomain_enable=true
openshift_auth_type=htpasswd

openshift_master_identity_providers=[{'name': 'htpasswd_auth', 'login': 'true', 'challenge': 'true', 'kind': 'HTPasswdPasswordIdentityProvider', 'filename': '/etc/origin/htpasswd'}]

deployment_type=openshift-enterprise
oreg_url=registry.xyz.com/openshift3/ose-${component}:${version}
openshift_docker_additional_registries=registry.xyz.com
openshift_docker_insecure_registries=registry.xyz.com
use_cluster_metrics=false
osm_use_cockpit=false

openshift_master_cluster_method=native
openshift_master_portal_net=172.24.0.0/14
osm_cluster_network_cidr=172.20.0.0/14
osm_host_subnet_length=8

openshift_node_kubelet_args={"max-pods": ["250"],"minimum-container-ttl-duration": ["10s"], "maximum-dead-containers-per-container": ["1"], "maximum-dead-containers": ["20"], "image-gc-high-threshold": ["80"], "image-gc-low-threshold": ["70"]}

openshift_registry_selector="region=infra,zone=default"
openshift_hosted_router_selector="region=infra,zone=default"
openshift_hosted_router_registryurl=registry.xyz.com/openshift3/ose-${component}:${version}
debug_level=2
openshift_set_hostname=true
openshift_override_hostname_check=true
os_sdn_network_plugin_name=redhat/openshift-ovs-multitenant
openshift_master_cluster_method=native

openshift_master_cluster_hostname=dhcp6-254.example.net
openshift_master_cluster_public_hostname=dhcp6-254.example.net

[lb]
dhcp6-254.example.net ansible_user=root ansible_ssh_user=root ansible_ssh_private_key_file="/root/.ssh/id_rsa_mykey"

